import React from 'react';
import '../styles/bio.css';


function bio() {

    return (
        <div class="full-height">
         <div id="bio" className="container">

            <img id="image" alt="my portrait" src="https://github.com/MaryiaVinogradova/Portfolio/blob/main/src/images/portrait%20option%201.jpg?raw=true" />

            <div className="main-content-div">
                <p className="p-for-about-me">I am an architect with more than 8 years of experience. Looking for a new opportunity in IT as full-stack developper. 

                </p>
            </div>
         </div>
        </div>
    )

}

export default bio;
